    public class Chave {
        private bool _state;
        public EventHandler ValueChanged;

        public Chave() {
            _state=false;
        }

        public bool Estado {
            get {
                return _state;
            }
            set {
                _state=value;
                ValueChanged?.Invoke(this,EventArgs.Empty);
            }
        }
    }

   
    public class Tabela {
        private List<Coord> _table;
        public Tabela()
        {
            _table = new List<Coord>();
        }
        public void Add(double x,double y, double z) {
            _table.Add(new Coord(x,y,z));
        }
        public int Count{
            get {
                return _table.Count;
            }
        }
        public void Add(Coord xyz) {
            _table.Add(xyz);
        }

        public void Clear() { 
            _table.Clear();
        }

        public List<double> GetXvalues() {
            List<double> list = new List<double>();
            try {
                foreach(var x in _table) {
                    if(x!=null)list.Add(x.X);
                }
            } finally { }
            return list;
        }
        public List<double> GetYvalues() {
            List<double> list = new List<double>();
            try {
                foreach(var y in _table) {
                   if(y!=null) list.Add(y.Y);
                }
             }finally { }
            return list;
        }
        public List<double> GetZvalues() {
            List<double> list = new List<double>();
            try {
                foreach(var z in _table) {
                    if(z!=null)list.Add(z.Z);
                }
            } finally { }
            return list;
        }

        public List<Coord> GetTable()
        {
            return new List<Coord>(_table);
        }

        public void AddXZvalue(double X, double Z) {
            int i = _table.FindIndex(lista => lista.Z==Z && lista.X==0);
            if(i!=-1) {
                _table[i].X=X;
            } else {
                Add(X,0,Z);
            }
        }
        public void AddYZvalue(double Y,double Z) {
            int i = _table.FindIndex(lista => lista.Z==Z&&lista.Y==0);
            if(i!=-1) {
                _table[i].Y=Y;
            } else {
                Add(0,Y,Z);
            }
        }
    }

    public class Coord {
        public double X { get; set; }
        public double Y { get; set; }
        public double Z { get; set; }

        public Coord() {
            X=0;
            Y=0;
            Z=0;
        }
        public Coord(double X,double Y,double Z) {
            this.X=X;
            this.Y=Y;
            this.Z=Z;
        }
    }

    public class ResultadosTPA {
        public double Hardness;
        public double Springiness;
        public double Cohesiveness;//max2/max1;
        public double Resilience;
        public double Adhesiveness;
        public double Gumminess;
        public double Chewiness;
        public double TamProd;

        public static ResultadosTPA CalcTPA(Tabela tb, double trigger) {
            int index0 = Ensaio.Calculo.SearchFirstOccurrence(tb.GetXvalues(),trigger,0,true);
            int index1 = Ensaio.Calculo.SearchFirstOccurrence(tb.GetXvalues(),trigger,index0+10,false);

            int index2 = Ensaio.Calculo.SearchFirstOccurrence(tb.GetXvalues(),trigger,index1+10,true);

            int index3 = Ensaio.Calculo.SearchFirstOccurrence(tb.GetXvalues(),trigger,index2+10,false);

            double max1 = tb.GetXvalues().GetRange(index0,(index1-index0)).Max();
            double max2 = tb.GetXvalues().GetRange(index2,(index3-index2)).Max();

            int indexp1 = Ensaio.Calculo.SearchFirstOccurrence(tb.GetXvalues(),max1,index0+10,false);
            int indexp2 = Ensaio.Calculo.SearchFirstOccurrence(tb.GetXvalues(),max2,index2+10,false);

            int indexMax1 = tb.GetXvalues().IndexOf(max1);
            int indexMax2 = tb.GetXvalues().IndexOf(max2);

            double A1 = Ensaio.Calculo.GetArea(tb.GetZvalues(),tb.GetXvalues(),index0,index1);
            double A2 = Ensaio.Calculo.GetArea(tb.GetZvalues(),tb.GetXvalues(),index2,index3);

            double A3 = Ensaio.Calculo.GetArea(tb.GetZvalues(),tb.GetXvalues(),index1,index2);

            double R1 = Ensaio.Calculo.GetArea(tb.GetZvalues(),tb.GetXvalues(),index0,indexMax1);
            double R2 = Ensaio.Calculo.GetArea(tb.GetZvalues(),tb.GetXvalues(),indexMax1,index1);
            ResultadosTPA res = new ResultadosTPA();

            res.Hardness = max1;
            res.Springiness = (tb.GetZvalues()[indexp2]-tb.GetZvalues()[index2])/((tb.GetZvalues()[indexp1]-tb.GetZvalues()[index0]));
            res.Cohesiveness = A2/A1;
            res.Resilience = R2/R1;
            res.Adhesiveness = A3<0?A3:0;
            res.Gumminess = res.Hardness*res.Cohesiveness;
            res.Chewiness = res.Gumminess*res.Springiness;      
            res.TamProd =tb.GetYvalues()[index0];

            return res;
        }
    }

